import React from 'react';
import './components.css';
import './footer.css';

function Footer() {
    return (
        <footer>
            <a href='https://github.com/dalto135/react-portfolio' target="_blank" rel='noreferrer'>
                This Portfolio was created with React!
            </a>
        </footer>
    );
}

export default Footer;
